import React, { } from 'react';
import '../../../App.css';

const Pagination = (props) => {

    return (
        <div>
            <nav aria-label="Page navigation example">
                <ul className="pagination justify-content-end">
                    <li className="page-item">
                        <button className="page-link"  onClick = {(inicio,fim)=>props.pagination(1,10)} >Previous</button>
                    </li>
                    <li className="page-item">{props.user.filter((user,indice) => indice%10===0).map((user,indice) => <button className="page-link"  onClick = {()=>props.pagination(1,10)}>1</button>)}</li>
                    <li className="page-item">
                        <button className="page-link" onClick = {(inicio,fim)=>props.pagination(2,10)} >Next</button>
                    </li>
                </ul>
            </nav>
        </div>
    )
}
export default (Pagination);
